  input: '"TEXT","F3A","C00304949","This amendment is in response to your letter stating
    a concern with the Amended April Quarterly Report (1/1/02-3/31/02) filed by the
    Watts for Congress Committee.  In your letter dated July 12, 2002, your report
    indicates that the report contained itemized entries for contributions made by
    more than one person.  Please note that Schedule A now itemizes spouses individually.  Please
    be advised that there is one contributor over their contribution limit.  A Reattribution/Redesignation
    request has been mailed to him.  If you need a copy of this letter we will be
    glad to forward it to you.  The committee has taken the necessary steps so this
    will not happen in the future.  If you have any further questions please let us
    know."'
